import { Button } from '../navbar/Button'
// import { SettingMonth } from './SettingMonth'
import { SettingYear } from './SettingYear'

function StepThree() {
    return (
        <div className="three">
            <div className="step-three">
                <header>
                    <h3>Pick add-ons</h3>
                    <span className="header-span">
                        Add-ons help enhance your gaming experience.
                    </span>
                </header>
                {/* <SettingMonth /> */}
                <SettingYear />
            </div>
            <Button />
        </div>
    )
}

export { StepThree }
